Wings on His Heels

Biography Documentary with no narration published by Productions l'oeil ouvert in 2011 - English language


Information
------------------------------

Jean BÃƒÂ©liveau took up an unprecedented challenge: go around the world on foot, in one go, without returning home once. A 75,000 km journey to which he devoted 11 years of his life in 64 countries.
Racked by a deep existential crisis, this neon signs salesman voluntarily withdrew himself from society. On August 18 2000, at 45 years old, he left in search of the essence of life, across the twists and turns of other cultures and with the primitive means of human, walking.
WINGS ON HIS HEELS introduces us to Jean BÃƒÂ©liveau in Brazil, in 2003, at a pivotal moment in his marathon: his final steps in the Americas and his passage to Africa; then, in East Timor, at the end of 2009, after 9 years of walking and more than 60,000 km behind him, steeped in the culture of the 60 countries in which he set foot.

